package ex_09_loop;

public class Lab0092_Forloop2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// We can use long, float for forloop but never use
		// string can not be use
		for(long i = 1l; i < 10; i++)
		{
			System.out.println(i);
		}
		
		for(float f = 0.01f; f< 10.67; f++ )
		{
			System.out.println("Hi float ->" +f);
		}
	}

}
